Need guidance on mongo aggregate lookup to count subnodes in all child nodes for each node<p>To better understand my problem, I've created a fake scenario of counting leaves in forests at all levels.</p>
<p>I need to provide total counts of leaves for all forests, for each forest, for each tree, and for each branch.  Thus, I need to output a tree structure that has all this info along with the IDs of each element so they can be identified.</p>
<p>Input data comes from 2 collections - forests and leaves.  I need to join the forests and leaves on branch_id, and output leaf counts and inject these counts into a structure equivalent to the forests collection (as a query result - not stored in the database).  Memory usage is a concern.  I was thinking I could do a join and read all these ids into memory, but there may be up to 100 forests.  Each forest likely has up to 10 trees, each tree has about 25 branches, each branch has up to 15 leaves.</p>
<pre><code>Forests collection
[
    {
        forest_id: 'forestA',
        trees: [
            {
                tree_id: 'treeA',
                branches: [
                    {
                         branch_id: 'branchA',
                    }
                ]
            }
        ]
    }
]

Leaves collection
[
    {
        leaf_id: 'leafA',
        branch_id: 'branchA'
    }
]
</code></pre>
<p>This is the desired output:</p>
<pre><code>{
    leaf_count: 9999999999,
    forests: [
       {
            leaf_count: 8888888,
            forest_id: 'forestA',
            trees: [
                {
                    leaf_count: 77777,
                    tree_id: 'treeA',
                    branches: [
                        {
                            leaf_count: 6666,
                            branch_id
                        }
                    ]
                }
            ]
        }
    ]
}
</code></pre>
<p>The aggregate pipeline I'm working on has all the desired output (built up to this point) in it, without any of the counts.  I'm thinking I need  to use facets here, and I'm worried about performance and I'm looking for what I should learn about to tackle this properly.  Any guidance would be much appreciated.  Thanks!</p>

